pragma solidity ^0.8.18;

import { ECDSA } from '@openzeppelin/contracts/utils/cryptography/ECDSA.sol';

/**
 * Verifies Proof-of-Authority and Proof-of-Signature validity. May be used to verify any Ethereum
 * signature.
 */
library ProofsVerification {
    using ECDSA for bytes32;

    /**
     * Verify Proof-of-Authority or Proof-of-Signature signature
     * @param _signer Signer of the data
     * @param _data Raw Proof-of-Authority stringified JSON object that the signer signs.
     *              Note: it may be the output of Proofs.getProofOfSignatureData function
     * @param _signature Signature of the {_data}
     * @return isValid Is signature valid or not
     */
    function verifySignedProof(
        address _signer,
        string memory _data,
        bytes calldata _signature
    ) public pure returns (bool) {
        bytes32 dataHash = keccak256(abi.encodePacked(_data));
        return verify(_signer, dataHash, _signature);
    }

    /**
     * Verify any Ethereum signature of any data
     * @param _signer Signer of the data
     * @param _dataHash Hash of the data that was signed
     * @param _signature Signature of the data
     * @return isValid Is signature valid or not
     */
    function verify(
        address _signer,
        bytes32 _dataHash,
        bytes calldata _signature
    ) public pure returns (bool) {
        return _dataHash.toEthSignedMessageHash().recover(_signature) == _signer;
    }
}","keccak256":"0xc4e9ff506def4284f9451cbeb64c58028f55badab9883f5e5cd9f667099d61d3","license":"UNLICENSED"},"contracts/libs/ProofsHelper.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.18;

import { ProofTypes } from './common/ProofTypes.sol';
import { StringsExpanded } from './StringsExpanded.sol';
import { IProofsMetadata } from '../interfaces/IProofMetadata.sol';

/**
 * ProofsHelper library helps Proofs smart contract to generate Proof-of-Authority, Proof-of-Signature, and
 * Proof-of-Agreement in a text format
 */
library ProofsHelper {
    using StringsExpanded for string;
    using StringsExpanded for bytes;
    using StringsExpanded for address;
    using StringsExpanded for uint256;

    /**
     * Returns full Proof-of-Authority or Proof-of-Signature (data with signature)
     * @param _creator Creator of the proof
     * @param _signature Signature of the proof data
     * @param _data Data that the user have signed
     * @return _proof The proof object as a string
     */
    function getProofOfAuthorityOrSignature(
        address _creator,
        bytes calldata _signature,
        string memory _data
    ) external pure returns (string memory _proof) {
        require(_creator != address(0), 'No creator');
        require(_signature.length > 0, 'No signature');
        require(_data.length() > 0, 'No data');
        _proof = string(
            abi.encodePacked(
                '{"address":"',
                _creator.toString(),
                '","sig":"',
                _signature.toHexString(),
                '","data":',
                _data,
                '}'
            )
        );
    }

    /**
     * Returns Proof-of-Authority data for the creator to sign
     * @param _proofsMetadata EIP712 part of the proof data defined in ProofsMetadata smart contract
     * @param _creator Creator of the agreement
     * @param _signers Signers of the agreement
     * @param _agreementFileCID IPFS CID of the agreement file
     * @param _version EIP712 version of the data
     * @param _timestamp Timestamp of the proof
     * @return data Proof-of-Authority data
     */
    function getProofOfAuthorityData(
        address _proofsMetadata,
        address _creator,
        address[] calldata _signers,
        string calldata _agreementFileCID,
        string calldata _version,
        uint256 _timestamp
    ) external view returns (string memory) {
        require(_creator != address(0), 'No creator');
        require(_signers.length > 0, 'No signers');
        require(_agreementFileCID.length() > 0, 'No Agreement File CID');
        require(_version.length() > 0, 'No version');

        return
            string(
                abi.encodePacked(
                    IProofsMetadata(_proofsMetadata).proofsMetadata(
                        ProofTypes.Proofs.ProofOfAuthority,
                        _version
                    ),
                    ',"message":',
                    getProofOfAuthorityDataMessage(
                        _creator,
                        _signers,
                        _agreementFileCID,
                        _timestamp
                    ),
                    '}'
                )
            );
    }

    /**
     * Returns Proof-of-Signature data for the signer to sign
     * @param _proofsMetadata EIP712 part of the proof data defined in ProofsMetadata smart contract
     * @param _signer Current signer of the agreement from the list of agreement signers
     * @param _proofOfAuthorityCID IPFS CID of the Proof-of-Authority
     * @param _version EIP712 version of the data
     * @param _timestamp Timestamp of the proof
     * @return data Proof-of-Signature data
     */
    function getProofOfSignatureData(
        address _proofsMetadata,
        address _signer,
        string calldata _proofOfAuthorityCID,
        string calldata _version,
        uint256 _timestamp
    ) external view returns (string memory) {
        require(_signer != address(0), 'No signer');
        require(_proofOfAuthorityCID.length() > 0, 'No Proof-of-Authority CID');
        require(_version.length() > 0, 'No version');

        return
            string(
                abi.encodePacked(
                    IProofsMetadata(_proofsMetadata).proofsMetadata(
                        ProofTypes.Proofs.ProofOfSignature,
                        _version
                    ),
                    ',"message":',
                    getProofOfSignatureDataMessage(_signer, _proofOfAuthorityCID, _timestamp),
                    '}'
                )
            );
    }

    /**
     * Returns Proof-of-Agreement data that is equal to Proof-of-Agreement as it requires no
     * signature
     * @param _proofOfAuthorityCID IPFS CID of the Proof-of-Authority
     * @param _proofsOfSignatureCID Array of IPFS CID of every Proof-of-Signature from the agreement
     * @param _timestamp Timestamp of the proof
     * @return data Proof-of-Agreement data
     */
    function getProofOfAgreementData(
        string calldata _proofOfAuthorityCID,
        string[] calldata _proofsOfSignatureCID,
        uint256 _timestamp
    ) external pure returns (string memory) {
        require(_proofOfAuthorityCID.length() > 0, 'No Proof-of-Authority CID');
        for (uint256 i = 0; i < _proofsOfSignatureCID.length; i++) {
            require(_proofsOfSignatureCID[i].length() > 0, 'No Proof-of-Signature CID');
        }

        string memory arrOfPoSigs = '{"proofCID":"';
        for (uint256 i = 0; i < _proofsOfSignatureCID.length; i++) {
            if (i != _proofsOfSignatureCID.length - 1) {
                arrOfPoSigs = string(
                    abi.encodePacked(arrOfPoSigs, _proofsOfSignatureCID[i], '"},{"proofCID":"')
                );
            } else {
                // the last proofCID
                arrOfPoSigs = string(
                    abi.encodePacked(arrOfPoSigs, _proofsOfSignatureCID[i], '"}]')
                );
            }
        }

        return
            string(
                abi.encodePacked(
                    '{"agreementFileProofCID":"',
                    _proofOfAuthorityCID,
                    '","agreementSignProofs":[',
                    arrOfPoSigs,
                    ',"timestamp":',
                    _timestamp.toString(),
                    '}'
                )
            );
    }

    /**
     * Returns the core message (without EIP712 metadata) of Proof-of-Authority for the creator to
     * sign
     * @param _creator Agreement creator address
     * @param _signers Array of signers of the agreement
     * @param _agreementFileCID IPFS CID of the agreement file
     * @return _message Proof-of-Authority message to sign
     */
    function getProofOfAuthorityDataMessage(
        address _creator,
        address[] calldata _signers,
        string calldata _agreementFileCID,
        uint256 _timestamp
    ) public pure returns (string memory _message) {
        _message = string(
            abi.encodePacked(
                '{"name":"Proof-of-Authority","from":"',
                _creator.toString(),
                '","agreementFileCID":"',
                _agreementFileCID,
                '","signers":',
                generateSignersJSON(_signers),
                ',"app":"daosign","timestamp":',
                _timestamp.toString(),
                ',"metadata":"{}"}'
            )
        );
    }

    /**
     * Returns the core message (without EIP712 metadata) of Proof-of-Signature for the signer to
     * sign
     * @param _signer Current signer of the agreement from the list of agreement signers
     * @param _proofOfAuthorityCID IPFS CID of the Proof-of-Authority
     * @param _timestamp Timestamp of the proof
     * @return _message Proof-of-Authority message to sign
     */
    function getProofOfSignatureDataMessage(
        address _signer,
        string calldata _proofOfAuthorityCID,
        uint256 _timestamp
    ) public pure returns (string memory _message) {
        _message = string(
            abi.encodePacked(
                '{"signer":"',
                _signer.toString(),
                '","agreementFileProofCID":"',
                _proofOfAuthorityCID,
                '","app":"daosign","timestamp":',
                _timestamp.toString(),
                ',"metadata":{}}'
            )
        );
    }

    /**
     * Generates a JSON stringified content with signers of the agreement
     * @param _signers Array of signers of the agreement
     * @return res JSON stringified list of signers
     */
    function generateSignersJSON(address[] calldata _signers) public pure returns (string memory) {
        string memory res = '[';

        for (uint256 i = 0; i < _signers.length; i++) {
            res = res.concat(
                string(abi.encodePacked('{"addr":"', _signers[i].toString(), '","metadata":"{}"}'))
            );
            if (i != _signers.length - 1) {
                res = res.concat(',');
            }
        }

        res = res.concat(']');

        return res;
    }
}","keccak256":"0x649e6ec5f79cfcf52df259b6ad6a3ce274135f9d686475efc0956eff8dc45dbc","license":"UNLICENSED"},"contracts/libs/StringsExpanded.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.18;

/**
 * Enhances operation with strings that are not possible in the current Solidity version (v0.8.18)
 */
library StringsExpanded {
    /**
     * @dev Compares two strings
     * @param _s1 One string
     * @param _s2 Another string
     * @return Are string equal
     */
    function equal(string memory _s1, string memory _s2) internal pure returns (bool) {
        return keccak256(abi.encodePacked(_s1)) == keccak256(abi.encodePacked(_s2));
    }

    /**
     * Gets length of the string
     * @param _s Input string
     * @return res The lenght of the string
     */
    function length(string memory _s) public pure returns (uint256) {
        return bytes(_s).length;
    }

    /**
     * Combines two input strings into one
     * @param _s1 The first string
     * @param _s2 The second string
     * @return res The resultant string created by merging s1 and s2
     */
    function concat(string memory _s1, string memory _s2) public pure returns (string memory) {
        return string(abi.encodePacked(_s1, _s2));
    }

    /**
     * Converts a `uint256` to its ASCII `string` decimal representation
     * @notice Inspired by OraclizeAPI's implementation - MIT licence
     * https://github.com/oraclize/ethereum-api/blob/b42146b063c7d6ee1358846c198246239e9360e8/oraclizeAPI_0.4.25.sol
     * @param _x Input number
     * @return res Number represented as a string
     */
    function toString(uint256 _x) public pure returns (string memory) {
        if (_x == 0) {
            return '0';
        }
        uint256 _temp = _x;
        uint256 _digits;
        while (_temp != 0) {
            _digits++;
            _temp /= 10;
        }
        bytes memory _buffer = new bytes(_digits);
        while (_x != 0) {
            _digits -= 1;
            _buffer[_digits] = bytes1(uint8(48 + uint256(_x % 10)));
            _x /= 10;
        }
        return string(_buffer);
    }

    /**
     * Converts an Ethereum address to a string
     * Note: only lowercase letters are used
     * @param _addr The Ethereum address to convert
     * @return res The string representation of the Ethereum address, including the '0x' prefix
     */
    function toString(address _addr) public pure returns (string memory) {
        bytes32 _bytes = bytes32(uint256(uint160(_addr)));
        bytes memory HEX = '0123456789abcdef';
        bytes memory str = new bytes(42);
        str[0] = '0';
        str[1] = 'x';
        for (uint i = 0; i < 20; i++) {
            str[i * 2 + 2] = HEX[uint8(_bytes[i + 12] >> 4)];
            str[i * 2 + 3] = HEX[uint8(_bytes[i + 12] & 0x0f)];
        }
        return string(str);
    }

    /**
     * Converts Solidity bytes to a string
     * @param _bytes Input bytes
     * @return res Input bytes in a string format with '0x' prefix
     */
    function toHexString(bytes memory _bytes) public pure returns (string memory) {
        bytes memory hexString = new bytes(_bytes.length * 2);

        uint256 index = 0;
        for (uint256 i = 0; i < _bytes.length; i++) {
            uint256 value = uint256(uint8(_bytes[i]));

            bytes1 highNibble = bytes1(uint8((value & 0xf0) >> 4));
            bytes1 lowNibble = bytes1(uint8(value & 0x0f));

            hexString[index++] = charToHex(highNibble);
            hexString[index++] = charToHex(lowNibble);
        }

        return string(abi.encodePacked('0x', string(hexString)));
    }

    function charToHex(bytes1 _char) private pure returns (bytes1) {
        if (uint8(_char) < 10) {
            return bytes1(uint8(_char) + 0x30); // '0' to '9'
        } else {
            return bytes1(uint8(_char) + 0x57); // 'a' to 'f'
        }
    }
}","keccak256":"0xb3480132ce0f48ca9c7e33005afc117d2d268aad436fc867ed1d2d8e705cb6ac","license":"UNLICENSED"},"contracts/libs/common/ProofTypes.sol":{"content":"
